	(67, 'Plan de PerforaciÃ³n de Pozos de alivio', -1, 'TIEMPO INDEFINIDO'),
	(68, 'Diplomas, Certificaciones,  CV con experiencia en DiseÃ±o y perforaciÃ³n de pozos\nProgramas de CapacitaciÃ³n, Instructores Certificados', -1, 'TIEMPO INDEFINIDO'),
	(69, 'PadrÃ³n del personal que operara equipos crÃ­ticos', -1, 'TIEMPO INDEFINIDO'),
	(70, 'Control de Cambios en el PadrÃ³n del personal', -1, 'TIEMPO INDEFINIDO'),
	(71, 'El Operador Petrolero deberÃ¡ adjuntar las normas propuestas para su adopciÃ³n, junto con la evaluaciÃ³n tÃ©cnica y la documentaciÃ³n soporte correspondiente.', -1, 'TIEMPO INDEFINIDO'),
	(72, 'PodrÃ¡n presentar, entre otros elementos, dictÃ¡menes, certificaciones o acreditaciones expedidos por los referidos Terceros Independientes. ', -1, 'TIEMPO INDEFINIDO'),
	(73, 'Informe de Abandono. Para el caso de Abandono de un Pozo, los Operadores Petroleros deberÃ¡n entregar a la ComisiÃ³n un informe donde detallen los resultados de la informaciÃ³n en materia de Abandono Temporal y Abandono Permanente de Pozos seÃ±alada en el artÃ­culo 24 de los Lineamientos. Lo anterior, dentro de los 15 dÃ­as hÃ¡biles posteriores a la finalizaciÃ³n de las actividades relacionadas con la remediaciÃ³n y Abandono realizados. \nEste informe deberÃ¡ contener los siguientes requisitos: \nl. NÃºmero de AsignaciÃ³n o Contrato;\nll. Nombre del Operador Petrolero\nlll. IdentificaciÃ³n y clasificaciÃ³n de Pozo\nIV. Fecha en la cual de abandono el Pozo\nV. Informe de Taponamiento, y\nVl. Estado mecÃ¡nico final del pozo', -1, 'TIEMPO INDEFINIDO'),
	(74, 'Toda la InformaciÃ³n relacionada con las actividades de PerforaciÃ³n, (Muestreos / Estudios / DictÃ¡menes / Otros).', -1, 'TIEMPO INDEFINIDO'),
	(75, 'Pagos por Derechos y aprovechamientos, Solicitudes de AutorizaciÃ³n de perforaciÃ³n, Modificaciones de programas de PerforaciÃ³n y cualquier pago referente a los Derechos y aprovechamientos en temas de perforaciÃ³n.', -1, 'TIEMPO INDEFINIDO'),
	(76, 'Procedimiento para realizar movimientos de los equipos en Pozos Costa Afuera, Programa de PerforaciÃ³n, Programa de Trabajo de armado y desarmado de equipos\nProcedimientos de cierre de Pozos, Procedimiento de armado y desarmado de equipos', -1, 'TIEMPO INDEFINIDO'),
	(77, 'Los Operadores Petroleros deberÃ¡n cumplir los siguientes requerimientos \ntÃ©cnicos y acciones al instalar el sistema de paro de emergencia a que se refiere el artÃ­culo 12 de los Lineamientos.\nI. Antes de realizar el movimiento de la unidad de perforaciÃ³n en una plataforma, se deben cerrar todos los Pozos que estÃ©n produciendo en la misma Ã¡rea de dicha plataforma. Los Pozos deben ser cerrados en la superficie con una vÃ¡lvula maestra y por debajo de la superficie, con una vÃ¡lvula de seguridad SSSV como barrera secundaria; \nll. En caso de que el Operador Petrolero considere conveniente utilizar un esquema diferente, debe notificarlo a la ComisiÃ³n en un plazo no mayor a quince dÃ­as hÃ¡biles posteriores al movimiento de la unidad de perforaciÃ³n. Se puede reanudar la producciÃ³n una vez que la unidad de perforaciÃ³n estÃ© en sus nuevas coordenadas, asegurada y lista para comenzar las actividades de PerforaciÃ³n y TerminaciÃ³n;\nlll. Los Operadores Petroleros pueden definir la distancia mÃ­nima de armado y \ndesarmado o movimiento de equipos, con base en un AnÃ¡lisis de Riesgos \nOperativos manifestado en su solicitud de AutorizaciÃ³n de PerforaciÃ³n, y\nlV. Los Operadores Petroleros, antes de la PerforaciÃ³n de un Pozo desde la misma plataforma donde existen otros Pozos productores, deben instalar una estaciÃ³n de paro de emergencia del equipo de perforaciÃ³n cerca de la consola del operador.', -1, 'TIEMPO INDEFINIDO'),
