	(435, '50', 'De los errores. ', 'Si derivado de alguna prueba, SupervisiÃ³n o AuditorÃ­a se demuestra que alguno o algunos de los elementos del Sistema de MediciÃ³n no han estado funcionando o que su operaciÃ³n ocasiona una desviaciÃ³n del 1% en el volumen medido, el Operador Petrolero deberÃ¡ realizar un ajuste para corregir su funcionamiento.', 'N/A', '185', 0, 'catalogo', 3, '0000-00-00'),
