BEGIN 

declare existe_usuario int; 
declare existe_cumplimiento int;
declare contador int;
declare nada int;
declare id_usuario_caso_especial varchar(1);
set id_usuario_caso_especial=id_usuario;
if id_usuario=-2 then
set id_usuario_caso_especial="A";
end if;
set existe_usuario=0;
set existe_cumplimiento=0;

SELECT count(*) AS contador, usuarios_cumplimientos.id_usuario,usuarios_cumplimientos.id_cumplimiento into contador,existe_usuario,existe_cumplimiento 
FROM usuarios_cumplimientos
WHERE usuarios_cumplimientos.id_usuario=id_usuario AND usuarios_cumplimientos.id_cumplimiento=id_cumplimiento;
if contador=0 then
usuarios_cumplimientos.ID_USUARIO=(id_usuario_caso_especial);
else 
set nada=1;
end if;
END//
